import React, { useEffect, useState } from "react";
import { useDispatch, useSelector } from "react-redux";
import { Link } from "react-router-dom";
import {
  adminProfile,
  allblockedUsers,
  blacklistUsers,
  blockUser,
} from "../../actions/adminActions";

import VisibilityIcon from "@mui/icons-material/Visibility";
import BookmarkIcon from "@mui/icons-material/Bookmark";

const BlackListed = () => {
  const dispatch = useDispatch();
  const adminProfileDetails = useSelector((state) => state.adminProfile);

  const [alert, setAlert] = useState(false);
  const { data } = adminProfileDetails;

  console.log(data);
  useEffect(() => {
    dispatch(adminProfile());
  }, []);

  const handleSubmit = (e) => {
    e.preventDefault();
    dispatch(allblockedUsers());
  };

  return (
    <div>
      {data
        ? data?.adminData?.adminData?.blacklistedUsers?.map((dt) => {
            return (
              <div key={dt?._id} className="talent-result">
                <div className="t-left">
                  <img
                    src={
                      dt?.employeeData?.image
                        ? dt?.employeeData?.image
                        : "https://t3.ftcdn.net/jpg/03/46/83/96/360_F_346839683_6nAPzbhpSkIpb8pmAwufkC7c5eD7wYws.jpg"
                    }
                    alt=""
                  />
                  <div>
                    <p style={{ color: "#3ccf4e" }}>{dt?.name}</p>
                    {/* <h4>{dt?.userTitle.slice(0, 20)}. . .</h4> */}
                    <p>
                      total earend:{" "}
                      <strong>{dt?.employeeData?.totalEarned}</strong>
                    </p>
                  </div>
                </div>

                <div className="t-right">
                  {/* <BookmarkBorderIcon
                  onClick={() => {
                    dispatch(saveTalents(dt?.owner?._id));
                    setAlret(true);
                    setTimeout(() => {
                      setAlret(false);
                    }, 1000);
                  }}
                  style={{ color: "#3ccf4e", cursor: "pointer" }}
                /> */}

                  {dt?.isBlocked ? (
                    <button
                      style={{
                        backgroundColor: "#FF6262",
                        border: "none",
                        padding: "10px 10px",
                        borderRadius: "5px",
                      }}
                    >
                      {" "}
                      <Link
                        onClick={(e) => {
                          dispatch(blockUser(dt?._id, "", dt?.userType));
                          setAlert(true);
                          setTimeout(() => {
                            setAlert(false);
                          }, 1500);
                        }}
                      >
                        {" "}
                        {dt?.isBlocked ? "unblock" : "block"}
                      </Link>
                    </button>
                  ) : (
                    <button
                      style={{
                        backgroundColor: "#3ccf4e",
                        border: "none",
                        padding: "10px 10px",
                        borderRadius: "5px",
                      }}
                    >
                      {" "}
                      <Link
                        onClick={(e) => {
                          dispatch(blockUser(dt?._id, "", dt?.userType));
                          setAlert(true);
                          setTimeout(() => {
                            setAlert(false);
                          }, 1500);
                        }}
                      >
                        {" "}
                        {dt?.isBlocked ? "unblock" : "block"}
                      </Link>
                    </button>
                  )}

                  <button
                    style={{
                      borderRadius: "50%",
                      width: "45px",
                      height: "45px",
                      backgroundColor: "#75E6FF",
                      border: "none",
                      marginLeft: "10px",
                    }}
                  >
                    {" "}
                    <Link to={`/user/publicView/${dt?._id}`}>
                      {" "}
                      <VisibilityIcon style={{ color: "white" }} />{" "}
                    </Link>
                  </button>

                  <button
                    onClick={(e) => {
                      dispatch(remo(dt?._id));

                      setAlert(true);
                      setTimeout(() => {
                        setAlert(false);
                      }, 1500);
                    }}
                    style={{
                      borderRadius: "50%",
                      width: "45px",
                      height: "45px",
                      backgroundColor: "#333333",
                      border: "none",
                      marginLeft: "10px",
                    }}
                  >
                    {" "}
                    <Link>
                      {" "}
                      <BookmarkIcon />{" "}
                    </Link>
                  </button>
                </div>
              </div>
            );
          })
        : ""}
    </div>
  );
};

export default BlackListed;
